/*
 * This is the primary high-level API for the project. In this folder there should be:
 * A class called InsightFacade, this should be in a file called InsightFacade.ts.
 * You should not change this interface at all or the test suite will not work.
 */

export enum InsightDatasetKind {
	Courses = "courses",
	Rooms = "rooms",
}

export interface InsightDataset {
	id: string;
	kind: InsightDatasetKind;
	numRows: number;
}

export interface InsightResult {
	[key: string]: string | number;
}

export class InsightError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, InsightError);
	}
}

export class NotFoundError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, NotFoundError);
	}
}

export class ResultTooLargeError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, ResultTooLargeError);
	}
}

export interface IInsightFacade {
	/**
	 * Add a dataset to insightUBC.
	 *
	 * @param id  The id of the dataset being added. Follows the format /^[^_]+$/
	 * @param content  The base64 content of the dataset. This content should be in the form of a serialized zip file.
	 * @param kind  The kind of the dataset
	 *
	 * @return Promise <string[]>
	 *
	 * The promise should fulfill on a successful add, reject for any failures.
	 * The promise should fulfill with a string array,
	 * containing the ids of all currently added datasets upon a successful add.
	 * The promise should reject with an InsightError describing the error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 * If id is the same as the id of an already added dataset, the dataset should be rejected and not saved.
	 *
	 * After receiving the dataset, it should be processed into a data structure of
	 * your design. The processed data structure should be persisted to disk; your
	 * system should be able to load this persisted value into memory for answering
	 * queries.
	 *
	 * Ultimately, a dataset must be added or loaded from disk before queries can
	 * be successfully answered.
	 */
	addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]>;

	/**
	 * Remove a dataset from insightUBC.
	 *
	 * @param id  The id of the dataset to remove. Follows the format /^[^_]+$/
	 *
	 * @return Promise <string>
	 *
	 * The promise should fulfill upon a successful removal, reject on any error.
	 * Attempting to remove a dataset that hasn't been added yet counts as an error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 *
	 * The promise should fulfill the id of the dataset that was removed.
	 * The promise should reject with a NotFoundError (if a valid id was not yet added)
	 * or an InsightError (invalid id or any other source of failure) describing the error.
	 *
	 * This will delete both disk and memory caches for the dataset for the id meaning
	 * that subsequent queries for that id should fail unless a new addDataset happens first.
	 */
	removeDataset(id: string): Promise<string>;

	/**
	 * Perform a query on insightUBC.
	 *
	 * @param query  The query to be performed.
	 *
	 * If a query is incorrectly formatted, references a dataset not added (in memory or on disk),
	 * or references multiple datasets, it should be rejected.
	 *
	 * @return Promise <InsightResult[]>
	 *
	 * The promise should fulfill with an array of results.
	 * The promise should reject with a ResultTooLargeError (if the query returns too many results)
	 * or an InsightError (for any other source of failure) describing the error.
	 */
	performQuery(query: unknown): Promise<InsightResult[]>;

	/**
	 * List all currently added datasets, their types, and number of rows.
	 *
	 * @return Promise <InsightDataset[]>
	 * The promise should fulfill an array of currently added InsightDatasets, and will only fulfill.
	 */
	listDatasets(): Promise<InsightDataset[]>;
}

import {
	IInsightFacade,
	InsightDataset,
	InsightDatasetKind,
	InsightError,
	InsightResult,
	NotFoundError,
	ResultTooLargeError
} from "./IInsightFacade";
import JSZip, {JSZipObject} from "jszip";
import Dataset from "./Dataset";
import {Section} from "./Section";
import * as fs from "fs";
import Ebnf from "./Ebnf";
import Engine from "./Engine";
import * as parser from "parse5";
import {Room} from "./Room";
import {Data} from "./Data";
import HTMLParser from "./HTMLParser";
import CourseFileParser from "./CourseFileParser";

const dataDir = "./data/";
const courseDir = "./data/courses/";
const roomDir = "./data/rooms/";
const jsonExtensionLength = 5;

/**
 * This is the main programmatic entry point for the project.
 * Method documentation is in IInsightFacade
 *
 */

function isOnlyWhiteSpace(str: string): boolean {
	return str == null || str.match(/^\s*$/) !== null;
}

export default class InsightFacade implements IInsightFacade {
	private datasets: Map<string, Dataset>;

	constructor() {
		console.log("InsightFacadeImpl::init()");
		this.datasets = new Map<string, Dataset>();

		if (!fs.existsSync(dataDir)) {
			fs.mkdirSync(dataDir);
		}
		if (!fs.existsSync(courseDir)) {
			fs.mkdirSync(courseDir);
		} else {
			const files: string[] = fs.readdirSync(courseDir);
			files.forEach((dataset_id) => {
				let id = dataset_id.substring(0, dataset_id.length - jsonExtensionLength);
				if (!this.datasets.has(id)) {
					const fileData = fs.readFileSync(courseDir + dataset_id, "utf-8");
					let dataArr: Data[] = JSON.parse(fileData); // fileData is def not empty and valid
					this.datasets.set(id, new Dataset(dataArr, dataArr.length, InsightDatasetKind.Courses));
				}
			});
		}
		if (!fs.existsSync(roomDir)) {
			fs.mkdirSync(roomDir);
		} else {
			const files: string[] = fs.readdirSync(roomDir);
			files.forEach((dataset_id) => {
				let id = dataset_id.substring(0, dataset_id.length - jsonExtensionLength);
				if (!this.datasets.has(id)) {
					const fileData = fs.readFileSync(roomDir + dataset_id, "utf-8");
					let dataArr: Data[] = JSON.parse(fileData); // fileData is def not empty and valid
					this.datasets.set(id, new Dataset(dataArr, dataArr.length, InsightDatasetKind.Rooms));
				}
			});
		}
	}

	public async addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		if (this.datasets.has(id) || id.includes("_") || isOnlyWhiteSpace(id)) {
			return Promise.reject(new InsightError("duplicate datasetID or invalid dataset id"));
		}
		if (kind === InsightDatasetKind.Courses) {
			await this.addDatasetCourses(id, content);
		} else if (kind === InsightDatasetKind.Rooms) {
			await this.addDatasetRooms(id, content);
		} else {
			return Promise.reject(new InsightError("Invalid kind of dataset added!"));
		}
		return new Promise((resolve) => {
			let arr: string[] = [];
			this.datasets.forEach((value, key) => {
				arr.push(key);
			});
			resolve(arr);
		});
	}

	private async addDatasetCourses(id: string, content: string) {
		let zip = new JSZip();
		try {
			await zip.loadAsync(content, {base64: true});
		} catch {
			return Promise.reject(new InsightError("invalid zip file - failed zip.loadAsync"));
		}

		let promises: Array<Promise<string>> = [];
		if (zip.folder(/courses/).length === 1) {
			zip.folder("courses")?.forEach(function (relativePath, file) {
				promises.push(file.async("string"));
			});
		} else {
			return Promise.reject(new InsightError("course folder does not contain any files"));
		}
		const fileArray = await Promise.all(promises);
		let sectionArray: Section[] = CourseFileParser.parseToSections(fileArray);

		if (sectionArray.length <= 0) {
			return Promise.reject(new InsightError("course folder does not contain any valid course sections"));
		}
		this.datasets.set(id, new Dataset(sectionArray, sectionArray.length, InsightDatasetKind.Courses));

		fs.writeFileSync(courseDir + id + ".json", JSON.stringify(sectionArray));
	}

	private async addDatasetRooms(id: string, content: string) {
		let zip1 = new JSZip();
		try {
			await zip1.loadAsync(content, {base64: true});
		} catch {
			return Promise.reject(new InsightError("invalid zip file - failed zip.loadAsync"));
		}

		let index: JSZipObject[] = zip1.file(/index.htm/);
		if (index.length <= 0) {
			return Promise.reject(new InsightError("room does not contain index.htm or room does not exist in root"));
		}

		let document;
		let htmlFile = zip1.file("rooms/index.htm");
		try {
			if (htmlFile !== null) {
				const htmlString = await htmlFile.async("string");
				document = parser.parse(htmlString);
			}
		} catch {
			return Promise.reject(new InsightError("unable to parse room, not in HTML format"));
		}

		let roomArray: Room[] = await HTMLParser.parseToBuildings(document, zip1);
		if (roomArray.length <= 0) {
			return Promise.reject(new InsightError("room folder does not contain any valid buildings with rooms"));
		}
		this.datasets.set(id, new Dataset(roomArray, roomArray.length, InsightDatasetKind.Rooms));

		fs.writeFileSync(roomDir + id + ".json", JSON.stringify(roomArray));
	}

	public removeDataset(id: string): Promise<string> {
		return new Promise((resolve, reject) => {
			if (this.datasets.has(id)) {
				let temp: any = this.datasets.get(id);
				this.deleteDisk(id, temp.getKind());
				this.datasets.delete(id);
				resolve(id);
			} else if (isOnlyWhiteSpace(id) || id.includes("_")) {
				reject(new InsightError("invalid ID"));
			} else {
				reject(new NotFoundError("ID not found"));
			}
		});
	}

	private deleteDisk(id: string, kind: string) {
		if (kind === "courses") {
			fs.unlink(courseDir + id + ".json", (err) => {
				if (err) {
					return Promise.reject(new InsightError("unable to delete in disk"));
				}
			});
		} else {
			fs.unlink(roomDir + id + ".json", (err) => {
				if (err) {
					return Promise.reject(new InsightError("unable to delete in disk"));
				}
			});
		}
	}

	public performQuery(query: unknown): Promise<InsightResult[]> {
		let ebnfChecker: Ebnf = new Ebnf(query);
		let resultArr: InsightResult[] = [];
		let dataset: Dataset | any;

		try {
			if (!ebnfChecker.isEbnf()) {
				return Promise.reject(new InsightError("EBNF failed"));
			}
			if (this.datasets.has(ebnfChecker.getArrID()[0])) {
				dataset = this.datasets.get(ebnfChecker.getArrID()[0]);
			} else {
				return Promise.reject(new InsightError("dataset does not exist"));
			}
			let runEngine = new Engine(query);
			resultArr = runEngine.applyQuery(dataset.getData());
			if (resultArr.length > 5000) {
				return Promise.reject(new ResultTooLargeError("result length > 5000"));
			}
		} catch (error) {
			return Promise.reject(error);
		}
		return Promise.resolve(resultArr);
	}

	public listDatasets(): Promise<InsightDataset[]> {
		let insightArr: InsightDataset[] = [];
		this.datasets.forEach((value, key) => {
			let rows = value.getRows();
			let kind = value.getKind();
			const myDataset: InsightDataset = {
				id: key,
				kind: kind,
				numRows: rows
			};
			insightArr.push(myDataset);
		});

		return new Promise<InsightDataset[]>((resolve) => {
			resolve(insightArr);
		});
	}
}

import {InsightDatasetKind} from "./IInsightFacade";
import {Data} from "./Data";

export default class Dataset {
	private readonly data: Data[];
	private readonly num_rows: number;
	private readonly datasetKind: InsightDatasetKind;

	constructor(data: Data[], rows: number, kind: InsightDatasetKind) {
		this.data = data;
		this.num_rows = rows;
		this.datasetKind = kind;
	}

	public getData(): Data[] {
		return this.data;
	}

	public getRows(): number {
		return this.num_rows;
	}

	public getKind(): InsightDatasetKind {
		return this.datasetKind;
	}
}

import EBNFHelper from "./EBNFHelper";

export default class Ebnf {
	private static where = "WHERE";
	private static options = "OPTIONS";
	private static columns = "COLUMNS";
	private static trans = "TRANSFORMATIONS";
	private query: any;
	private arrId: any[];

	constructor(query: any) {
		this.query = query;
		this.arrId = [];
	}

	public getArrID() {
		return this.arrId;
	}

	public isEbnf(): boolean {
		let allKeys = Object.keys(this.query);
		if (typeof this.query !== "object" || !(allKeys.length === 2 || allKeys.length === 3)) {
			return false;
		}
		if (!allKeys.includes(Ebnf.trans)) {
			if (allKeys.indexOf(Ebnf.where) === 0 && allKeys.indexOf(Ebnf.options) === 1) {
				let queryWhere = this.query[Ebnf.where];
				let queryOptions = this.query[Ebnf.options];
				let whereSuccess = this.checkWhere(queryWhere);
				let optionsSuccess = this.checkOptions(queryOptions);
				return whereSuccess && optionsSuccess && this.isReferencingSameDataset();
			} else {
				return false;
			}
		} else {
			if (allKeys.indexOf(Ebnf.where) === 0 && allKeys.indexOf(Ebnf.options) === 1
				&& allKeys.indexOf(Ebnf.trans) === 2) {
				let queryWhere = this.query[Ebnf.where];
				let queryOptions = this.query[Ebnf.options];
				let queryTrans = this.query[Ebnf.trans];
				let whereSuccess = this.checkWhere(queryWhere);
				let optionsSuccess = this.checkOptions(queryOptions);
				let transSuccess = this.checkTrans(queryTrans);
				return whereSuccess && optionsSuccess && transSuccess && this.isReferencingSameDataset();
			} else {
				return false;
			}
		}
	}

	private checkWhere(whereQuery: any): boolean {
		if (Object.keys(whereQuery).length === 0) {
			return true;
		}
		if (Object.keys(whereQuery).length > 1) {
			return false;
		}

		let outerKey = Object.keys(whereQuery)[0];
		if (outerKey === "IS") {
			return this.checkSComp(whereQuery["IS"]);
		} else if (EBNFHelper.isMComparator(outerKey)) {
			return this.checkMComp(whereQuery, outerKey);
		} else if (EBNFHelper.isLogic(outerKey)) {
			return this.checkLogic(whereQuery, outerKey);
		} else if (outerKey === "NOT") {
			return this.checkNegation(whereQuery["NOT"]);
		} else {
			return false;
		}
	}

	private checkNegation(NotQuery: any): boolean {
		return this.checkWhere(NotQuery);
	}

	private checkLogic(whereQuery: any, outerKey: string): boolean {
		let bool = false;
		let arr = whereQuery[outerKey];
		if (arr.length < 1) {
			return false;
		}
		for (let item of arr) {
			bool = this.checkWhere(item);
			if (!bool) {
				return bool;
			}
		}
		return bool;
	}

	private checkMComp(whereQuery: any, outerKey: string) {
		if (typeof whereQuery !== "object" || Object.keys(whereQuery[outerKey]).length !== 1) {
			return false;
		}
		let key = Object.keys(whereQuery[outerKey])[0];
		return this.checkMKey(key) && typeof whereQuery[outerKey][key] === "number";
	}

	private checkSComp(IsQuery: any): boolean {
		if (typeof IsQuery !== "object" || Object.keys(IsQuery).length !== 1) {
			return false;
		}
		let isKey = Object.keys(IsQuery)[0];
		return this.checkSKey(isKey) && typeof (IsQuery[isKey]) === "string"
			&& EBNFHelper.inputStringLegal(IsQuery[isKey]);
	}

	private checkOptions(queryOptions: any): boolean {
		let allKeys = Object.keys(queryOptions);
		if (!(allKeys.length === 1 || allKeys.length === 2) || Object.keys(queryOptions)[0] !== (Ebnf.columns)) {
			return false;
		}
		if (Object.keys(queryOptions).length === 2) {
			if (Object.keys(queryOptions)[1] !== "ORDER") {
				return false;
			} else {
				return this.checkColumns(queryOptions[Ebnf.columns]) && this.checkOrder(queryOptions["ORDER"]);
			}
		} else {
			return this.checkColumns(queryOptions[Ebnf.columns]);
		}
		return false;
	}

	private checkColumns(arr: any): boolean {
		if (arr.length < 1) {
			return false;
		}
		let bool = true;
		if (Object.keys(this.query).includes(Ebnf.trans)) {
			let groupKeys = this.query[Ebnf.trans]["GROUP"];
			let applyKey = [];
			for (let k of this.query[Ebnf.trans]["APPLY"]) {
				applyKey.push(Object.keys(k)[0]);
			}
			for (let column of arr) {
				bool = this.checkAnyKey(column) && (groupKeys.includes(column) || applyKey.includes(column));
				if (!bool) {
					return bool;
				}
			}
			return bool;
		} else {
			for (let column of arr) {
				bool = this.checkAnyKey(column);
				if (!bool) {
					return bool;
				}
			}
			return bool;
		}
	}

	private checkOrder(queryOrder: string | any): boolean {
		if (typeof queryOrder === "string") {
			return this.checkAnyKey(queryOrder) && this.checkKeyInColumns(queryOrder);
		} else {
			return this.checkDirKeys(queryOrder);
		}
	}

	private checkKeyInColumns(queryOrder: string) {
		return this.query["OPTIONS"]["COLUMNS"].includes(queryOrder);
	}

	private checkDirKeys(queryOrder: any) {
		if (Object.keys(queryOrder).length !== 2) {
			return false;
		} else if (Object.keys(queryOrder)[0] !== "dir" || Object.keys(queryOrder)[1] !== "keys") {
			return false;
		}
		return EBNFHelper.checkDir(Object.values(queryOrder)[0]) && this.checkKeysOrder(Object.values(queryOrder)[1]);
	}

	private checkKeysOrder(arr: any): boolean {
		if (arr.length < 1) {
			return false;
		}
		let bool = true;
		for (let a of arr) {
			bool = this.checkAnyKey(a) && this.checkKeyInColumns(a);
			if (!bool) {
				return false;
			}
		}
		return bool;
	}

	private checkTrans(queryTrans: any) {
		let keys = Object.keys(queryTrans);
		if (keys.length !== 2 || !keys.includes("GROUP") || !keys.includes("APPLY")) {
			return false;
		}
		return this.checkGroup(queryTrans["GROUP"]) && this.checkApply(queryTrans["APPLY"]);
	}

	private checkGroup(queryGroup: any) {
		if (queryGroup.length < 1) {
			return false;
		}
		let bool = true;
		for (let i of queryGroup) {
			bool = this.checkKey(i);
			if (!bool) {
				return false;
			}
		}
		return bool;
	}

	private checkApply(queryApply: any) {
		let bool = true;
		let allApplyKeys: string[] = [];
		for (let item of queryApply) {
			if (allApplyKeys.includes(Object.keys(item)[0])) {
				return false;
			}
			bool = this.checkApplyRule(item);
			if (!bool) {
				return false;
			}
			allApplyKeys.push(Object.keys(item)[0]);
		}
		return bool;
	}

	private checkApplyRule(item: any): boolean {
		if (Object.keys(item).length !== 1) {
			return false;
		}
		return EBNFHelper.checkIdStringAndApplyKey(Object.keys(item)[0])
			&& this.checkApplyToken(Object.values(item)[0]);
	}

	private checkApplyToken(item: any): boolean {
		if (Object.keys(item).length !== 1) {
			return false;
		}
		return EBNFHelper.checkTokenKey(Object.keys(item)[0]) && this.checkKey(Object.values(item)[0])
			&& EBNFHelper.checkTokenCompat(Object.keys(item)[0], Object.values(item)[0]);
	}

	private checkKey(key: any) {
		return this.checkSKey(key) || this.checkMKey(key);
	}

	private checkSKey(key: string) {
		let arr = key.split("_");
		this.arrId.push(arr[0]);
		return arr.length === 2 && EBNFHelper.checkIdStringAndApplyKey(arr[0]) && EBNFHelper.checkSfield(arr[1]);
	}

	private checkMKey(key: string) {
		let arr = key.split("_");
		this.arrId.push(arr[0]);
		return EBNFHelper.checkIdStringAndApplyKey(arr[0]) && EBNFHelper.checkMfield(arr[1]);
	}


	private checkAnyKey(column: string): boolean {
		if (column.split("_").length === 1) {
			return EBNFHelper.checkIdStringAndApplyKey(column);
		} else {
			return this.checkKey(column);
		}
	}

	private isReferencingSameDataset(): boolean {
		let flag = true;
		let i;
		for (i = 0; i < this.arrId.length; i++) {
			if (this.arrId[i] !== this.arrId[0]) {
				flag = false;
			}
		}
		return flag;
	}
}

export default class EBNFHelper {
	public static inputStringLegal(str: any): boolean {
		return (/[*]?[^*]*[*]?/.test(str));
	}

	public static checkIdStringAndApplyKey(idQuery: string): boolean {
		return (/^[^_]+$/.test(idQuery)); // todo
	}

	public static isMComparator(val: string): boolean {
		return (val === "GT" || val === "LT" || val === "EQ");
	}

	public static isLogic(val: string): boolean {
		return (val === "AND" || val === "OR");
	}

	public static checkMfield(str: string): boolean {
		return (str === "avg" || str === "pass" || str === "fail" || str === "audit" || str === "year"
			|| str === "lat" || str === "lon" || str === "seats");
	}

	public static checkSfield(str: string): boolean {
		return (str === "dept" || str === "id" || str === "instructor" || str === "title" || str === "uuid"
			|| str === "fullname" || str === "shortname" || str === "number" || str === "name" || str === "address"
			|| str === "type" || str === "furniture" || str === "href");
	}

	public static checkDir(string: any): boolean {
		return string === "UP" || string === "DOWN";
	}

	public static checkTokenKey(string: string): boolean {
		return string === "MAX" || string === "MIN" || string === "AVG" || string === "COUNT" || string === "SUM";
	}

	public static checkTokenCompat(s: any, key: any): boolean {
		if (s === "MAX" || s === "MIN" || s === "AVG" || s === "SUM"){
			let splitArr = key.split("_");
			if (!EBNFHelper.checkMfield(splitArr[1])) {
				return false;
			}
		}
		return true;
	}
}

import {InsightResult} from "./IInsightFacade";
import {Data} from "./Data";
import {AggregateHelper} from "./AggregateHelper";

export default class Engine {
	private resultArr: InsightResult[];
	private query: any;

	constructor(query: any) {
		this.resultArr = [];
		this.query = query;
	}


	public applyQuery(valid_data: []): InsightResult[] {
		let filteredData = this.applyWhere(this.query, valid_data);
		if (!Object.keys(this.query).includes("TRANSFORMATIONS")) {
			this.resultArr = this.applyOptions(this.query, filteredData);
		} else {
			let groupedData = this.applyTransform(this.query, filteredData);
			this.resultArr = this.applyOptions(this.query, groupedData);
		}
		return this.resultArr;
	}

	private applyWhere(query: any, valid_data: []): Data[] {
		let queryW = query["WHERE"];
		return this.applyFilter(queryW, valid_data);
	}

	private applyFilter(queryW: any, valid_data: []): Data[] {
		let key = Object.keys(queryW)[0];
		let result: Data[] = [];

		if (Object.keys(queryW).length === 0) {
			return valid_data;
		} else if (key === "OR") {
			let temp: any = this.applyOr(queryW[key], valid_data);
			result = result.concat(temp);
		} else if (key === "AND") {
			let temp: any = this.applyAnd(queryW[key], valid_data);
			result = result.concat(temp);
		} else if (key === "GT" || key === "LT" || key === "EQ") {
			let temp: any = this.applyMComp(queryW[key], key, valid_data);
			result = result.concat(temp);
		} else if (key === "IS") {
			let temp: any = this.applyIS(queryW[key], valid_data);
			result = result.concat(temp);
		} else if (key === "NOT") {
			let temp: any = this.applyNot(queryW[key], valid_data);
			result = result.concat(temp);
		}
		return result;
	}

	private applyOr(queryWElement: any, valid_data: []): Data[] {
		let result: Data[] = [];
		let i = 0;
		let temp: any = valid_data;
		while (i < queryWElement.length) {
			let s = this.applyFilter((queryWElement)[i], temp);
			temp = temp.filter((item: any) => s.indexOf(item) < 0);
			result = result.concat(s);
			i++;
		}
		return result;
	}

	private applyAnd(queryWElement: any, valid_data: []): Data[] {
		let result: Data[] = [];
		let i = 0;
		let temp: any = valid_data;
		while (i < queryWElement.length) {
			result = this.applyFilter((queryWElement)[i], temp);
			temp = result;
			i++;
		}
		return result;
	}

	private applyMComp(query: any, key: string, valid_data: []): Data[] {
		let result: Data[] = [];
		let keyVal: any = Object.keys(query)[0];
		let num: any = Object.values(query)[0];
		let mField = keyVal.split("_", 2)[1];
		for (let data of valid_data) {
			result = this.addData(key, mField, data, num, result);
		}
		return result;
	}

	private addData(key: string, mField: string, data: any, num: any, result: Data[]) {
		if (key === "GT") {
			let v = data[mField];
			if (v > num) {
				result.push(data);
			}
		} else if (key === "LT") {
			let v = data[mField];
			if (v < num) {
				result.push(data);
			}
		} else if (key === "EQ") {
			let v = data[mField];
			if (v === num) {
				result.push(data);
			}
		}
		return result;
	}

	private applyIS(query: any, valid_data: []): Data[] {
		let result: InsightResult[] = [];
		let keyVal: any = Object.keys(query)[0];
		let param: any = Object.values(query)[0];
		let val = keyVal.split("_", 2)[1];
		if (param === "*" || param === "**") {
			return valid_data;
		} else {
			for (let data of valid_data) {
				this.pushDataToResultOnEQ(data, val, param, result);
			}
		}
		return result;
	}

	private pushDataToResultOnEQ(data: any, val: any, param: string, result: Data[]) {
		let x: string = data[val];
		if (param.substring(0, 1) === "*" && param.substring(param.length - 1) === "*") {
			if (x.includes(param.substring(1, param.length - 1))) {
				result.push(data);
			}
		} else if (param.substring(0, 1) === "*") {
			if (param.substring(1) === x.substring(x.length - (param.length - 1))) {
				result.push(data);
			}
		} else if (param.substring(param.length - 1) === "*") {
			if (param.substring(0, param.length - 1) === x.substring(0, param.length - 1)) {
				result.push(data);
			}
		} else {
			if (param === x) {
				result.push(data);
			}
		}
	}

	private applyNot(query: any, valid_data: []): Data[] {
		let result: Data[] = [];
		let notResult: any = this.applyFilter(query, valid_data);
		let newSet = new Set(notResult);

		for (let data of valid_data) {
			if (!newSet.has(data)) {
				result.push(data);
			}
		}
		return result;
	}

	private applyTransform(query: any, filtered_data: Data[]): any {
		let queryTransform = query["TRANSFORMATIONS"];
		let queryGroup = queryTransform["GROUP"];
		let queryApply = queryTransform["APPLY"];

		let res = [];
		let groupedKeys = this.getGroupKeys(queryGroup);
		let mapGroup = this.groupBy(groupedKeys, filtered_data);
		let arrMapKeys = [...mapGroup.keys()];
		for (let mapKey of arrMapKeys) {
			let aggregatedRes: any = this.aggregate(queryApply, mapKey, mapGroup);
			res.push(aggregatedRes);
		}
		return res;
	}

	private groupBy(groupedKeys: string[], filtered_data: Data[]): any {
		let map: Map<string, Data[]> = new Map();
		// todo check if two arry keys are equal by checking if they contain the same members which are string
		for (let data of filtered_data) {
			const key = this.generateKey(data, groupedKeys);
			const collection = map.get(key);
			if (!collection) {
				map.set(key, [data]);
			} else {
				collection.push(data);
			}
		}
		return map;
	}

	private getGroupKeys(queryGroup: string[]): string[] {
		let groupedKeys = [];
		for (let key of queryGroup) {
			groupedKeys.push(key.split("_")[1]);
		}
		return groupedKeys;
	}

	private generateKey(data: any, groupedKeys: string[]): string {
		let retKey = "";
		for (let key of groupedKeys) {
			retKey = retKey.concat(data[key] + ",");
		}
		return retKey.substring(0, retKey.length - 1);
	}

	private aggregate(queryApply: any, mapKey: any, mapGroup: any) {
		let ret: any = {};
		let mapVal = mapGroup.get(mapKey);
		for (let op of queryApply) {
			let key = Object.keys(op)[0];
			let valAggregate = op[key];
			const groupVal = this.getAggregateVal(mapVal, valAggregate);
			ret[key] = groupVal;
		}
		let i = 0;
		for (let key of mapKey.split(",")) {
			let t = this.query["TRANSFORMATIONS"]["GROUP"][i].split("_")[1];
			ret[t] = key;
			i++;
		}
		return ret;
	}

	private getAggregateVal(groupArr: any, valAggregate: any) {
		let key = Object.keys(valAggregate)[0];
		let value = Object.values(valAggregate)[0];
		if (key === "MAX") {
			return AggregateHelper.handleMax(groupArr, value);
		} else if (key === "MIN") {
			return AggregateHelper.handleMin(groupArr, value);
		} else if (key === "COUNT") {
			return AggregateHelper.handleCount(groupArr, value);
		} else if (key === "SUM") {
			return AggregateHelper.handleSum(groupArr, value);
		} else if (key === "AVG") {
			return AggregateHelper.handleAvg(groupArr, value);
		} else {
			throw new Error("MAX MIN COUNT ...");
			// todo, shouldn;'t have gotten here
		}
	}

	private applyOptions(query: any, data: any): InsightResult[] {
		let allKeys = Object.keys(query["OPTIONS"]);
		let columns = allKeys[0];
		let colKeys = query["OPTIONS"][columns];
		let organizedData = [];
		for (let d of data) {
			let i = 0;
			let obj: InsightResult = {};
			while (i < Object.keys(colKeys).length) {
				if (colKeys[i].includes("_")) {
					let columnKey = colKeys[i].split("_", 2)[1];
					let key = colKeys[i];
					obj[key] = d[columnKey];
				} else {
					obj[colKeys[i]] = d[colKeys[i]];
				}
				i++;
			}
			organizedData.push(obj);
		}

		if (allKeys.includes("ORDER")) {
			let val: any = query["OPTIONS"]["ORDER"];
			if (typeof val === "string") {
				organizedData.sort((a: any, b: any) => {
					return a[val] - b[val];
				});
			} else {
				let dir = Object.values(val)[0];
				let keys = Object.values(val)[1];
				if (dir === "DOWN") {
					AggregateHelper.sortDec(organizedData, keys);
				} else if (dir === "UP") {
					AggregateHelper.sortInc(organizedData, keys);
				}
			}
		}
		return organizedData;
	}
}

import Decimal from "decimal.js";
import {InsightResult} from "./IInsightFacade";

export class AggregateHelper {

	public static handleMax(groupArr: any, value: any) {
		let max = groupArr[0][value.split("_")[1]];
		for (let data of groupArr) {
			let cur = data[value.split("_")[1]];
			if (cur > max) {
				max = cur;
			}
		}
		return parseInt(max, 10);
	}

	public static handleMin(groupArr: any, value: any) {
		let min = groupArr[0][value.split("_")[1]];
		for (let data of groupArr) {
			let cur = data[value.split("_")[1]];
			if (cur < min) {
				min = cur;
			}
		}
		return parseInt(min, 10);
	}

	public static handleCount(groupArr: any, value: any) {
		let count = 0;
		let existed: any = [];
		for (let data of groupArr) {
			let val = data[value.split("_")[1]];
			if (!existed.includes(val)) {
				count++;
				existed.push(val);
			}
		}
		return count;
	}

	public static handleSum(groupArr: any, value: any) {
		let total = new Decimal(0);
		for (let data of groupArr) {
			let key = value.split("_")[1];
			let cur = new Decimal(data[key]);
			total = total.add(cur);
		}
		return Number(total.toFixed(2));
	}

	public static handleAvg(groupArr: any, value: any) {
		let total = new Decimal(0);
		let rows = 0;
		for (let data of groupArr) {
			let key = value.split("_")[1];
			let cur = new Decimal(data[key]);
			total = total.add(cur);
			rows++;
		}
		let avg = total.toNumber() / rows;
		let res = Number(avg.toFixed(2));
		return res;
	}

	public static sortDec(organizedData: InsightResult[], keys: any) {
		organizedData.sort(function (a, b): number {
			for (let k of keys) {
				if (a[k] < b[k]) {
					return 1;
				} else if (a[k] > b[k]) {
					return -1;
				}
			}
			return 0;
		});
	}

	public static sortInc(organizedData: InsightResult[], keys: any) {
		organizedData.sort(function (a, b): number {
			for (let k of keys) {
				if (a[k] < b[k]) {
					return -1;
				} else if (a[k] > b[k]) {
					return 1;
				}
			}
			return 0;
		});
	}
}

import {Room} from "./Room";
import HTMLParserHelper from "./HTMLParserHelper";
import JSZip from "jszip";

export default class HTMLParser {
	public static validRoom = "no valid room";

	public static async parseToBuildings(document: any, zip: JSZip): Promise<Room[]> {
		const table = this.getTable(document);
		const tbody = this.tableToBody(table);
		if (tbody === null) {
			return [];
		}
		const trows = this.getTrows(tbody);

		let promises: Array<Promise<Room[]>> = [];
		for (let trow of trows) {
			const buildingPromise: Promise<Room[]> = this.parseToBuilding(trow, zip);
			promises.push(buildingPromise);
		}

		let arrBuildings: Room[][] = [];
		try {
			arrBuildings = await Promise.all(promises);
		} catch (error) {
			console.log(error);
		}

		let buildings: Room[] = [];
		for (let building of arrBuildings) {
			buildings = buildings.concat(building);
		}
		return buildings;
	}

	public static async parseToBuilding(trow: any, zip: JSZip): Promise<Room[]> {
		const href = HTMLParserHelper.getHref(trow);
		const buildingCode = HTMLParserHelper.getShortName(trow);
		const buildingName = HTMLParserHelper.getFullName(trow);
		const buildingAddy = HTMLParserHelper.getAddy(trow);

		const roomDocument = await HTMLParserHelper.getParsedRoomDocument(href, zip);
		return this.parseToRooms(roomDocument, buildingCode, buildingName, buildingAddy);
	}

	public static async parseToRooms(roomDocument: any, buildingCode: string, buildingName: string, buildingAddy:
		string): Promise<Room[]> {
		const tableRooms = this.getTable(roomDocument);
		const tbodyRooms = this.tableToBody(tableRooms);
		if (tbodyRooms === null) {
			return [];
		}
		const trowsRooms = this.getTrows(tbodyRooms);
		let promises = [];
		for (let trowRoom of trowsRooms) {
			let promise: Promise<Room | null> = this.parseToRoom(trowRoom, buildingCode, buildingName, buildingAddy);
			promises.push(promise);
		}
		let rooms: Room[] = [];
		const arrRooms = await Promise.all(promises);
		for (let room of arrRooms) {
			if (room !== null) {
				rooms.push(room);
			}
		}
		return rooms;
	}

	public static async parseToRoom(trowRoom: any, buildingCode: string, buildingName: string, buildingAddy: string):
		Promise<Room | null> {
		const roomNumber: string = HTMLParserHelper.getRoomNumber(trowRoom);
		const roomName: string = buildingCode + "_" + roomNumber;
		const roomSeat: number = HTMLParserHelper.getCapacity(trowRoom);
		const roomType: string = HTMLParserHelper.getRoomType(trowRoom);
		const furnitureType: string = HTMLParserHelper.getFurnitureType(trowRoom);
		const hrefOnline: string = HTMLParserHelper.getHref(trowRoom);
		const location: {[key: string]: number} = await HTMLParserHelper.getLocation(trowRoom, buildingAddy);
		const latitude: number = location["latitude"];
		const longitude: number = location["longitude"];

		if (roomNumber === HTMLParser.validRoom || Object.prototype.hasOwnProperty.call(location, "error")) {
			return null;
		}

		return {
			address: buildingAddy,
			fullname: buildingName,
			shortname: buildingCode,
			name: roomName,
			type: roomType,
			furniture: furnitureType,
			number: roomNumber,
			seats: roomSeat,
			lat: latitude,
			lon: longitude,
			href: hrefOnline,
		};
	}

	public static getTable(document: any): any {
		let ret = null;
		if (document.nodeName === "table" && this.hasCorrectTableAttr(document)) {
			ret = document;
			return ret;
		} else {
			if (Object.prototype.hasOwnProperty.call(document, "childNodes")) {
				for (let node of document.childNodes) {
					ret = this.getTable(node);
					if (ret !== null) {
						break;
					}
				}
			}
			return ret;
		}
	}

	public static hasCorrectTableAttr(document: any): boolean {
		const attributes: any[] = document.attrs;
		let ret = false;
		for (let attr of attributes) {
			if (attr.name === "class") {
				ret = attr.value === "views-table cols-5 table";
			}
			break;
		}
		return ret;
	}

	public static tableToBody(document: any): any {
		if (document === null) {
			return null;
		}
		const children = document.childNodes;
		let ret;
		for (let attr of children) {
			if (attr.nodeName === "tbody") {
				ret = attr;
				break;
			}
		}
		return ret;
	}

	public static getTrows(tbody: any): any {
		let trows: any[] = [];
		tbody.childNodes.forEach((childNode: {nodeName: string;}) => {
			if (childNode.nodeName === "tr") {
				trows.push(childNode);
			}
		});
		return trows;
	}
}

