				for (let child of trowRoom.childNodes) {
					type = this.getFurnitureType(child);
					if (type !== "") {
						break;
					}
				}
			}
			return type;
		}
	}

	public static async getLocation(trowRoom: any, buildingAddy: string): Promise<{[key: string]: number}> {
		const link = GetLocationHelper.getHTML(buildingAddy);
		return new Promise((resolve, reject) => {
			http.get(link, (response) => {
				let data = "";
				response.setEncoding("utf8");
				response.on("data", (chunk) => {
					data += chunk;
				});
				response.on("end", () => {
					const ret = GetLocationHelper.getLongLat(JSON.parse(data));
					resolve(ret);
				});
			}).on("error", (err) => {
				reject(new InsightError("Error get Request: " + err.message)); // todo on error, why does it fail?
			});
		});
	}
}

